import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import "../../styles/HomePage.css";
import {
  FaFacebook,
  FaTwitter,
  FaInstagram,
  FaPinterest,
} from "react-icons/fa";

const HomePage = () => {
  // Form state
  const [countryCode, setCountryCode] = useState("+91");
  const [phone, setPhone] = useState("");
  const [inquiry, setInquiry] = useState("myself");
  const [workExp, setWorkExp] = useState("");

  // Countdown state
  const [days, setDays] = useState("00");
  const [hours, setHours] = useState("00");
  const [minutes, setMinutes] = useState("00");
  const [seconds, setSeconds] = useState("00");

  // Target date/time: 12th March (Year can be adjusted)
  const targetDate = new Date("2025-08-12T00:00:00");

  // Countdown logic
  useEffect(() => {
    const interval = setInterval(() => {
      const now = new Date();
      const distance = targetDate - now;

      if (distance <= 0) {
        setDays("00");
        setHours("00");
        setMinutes("00");
        setSeconds("00");
        clearInterval(interval);
      } else {
        const d = Math.floor(distance / (1000 * 60 * 60 * 24));
        const h = Math.floor(
          (distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60)
        );
        const m = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
        const s = Math.floor((distance % (1000 * 60)) / 1000);

        setDays(String(d).padStart(2, "0"));
        setHours(String(h).padStart(2, "0"));
        setMinutes(String(m).padStart(2, "0"));
        setSeconds(String(s).padStart(2, "0"));
      }
    }, 1000);

    return () => clearInterval(interval);
  }, [targetDate]);

  // Submit form data to the backend
  const handleSubmitApplication = async () => {
    try {
      const response = await axios.post(
        "http://localhost:3006/api/applications",
        {
          countryCode,
          phone,
          inquiry,
          workExp,
        }
      );
      alert("Application submitted successfully!");
      setPhone("");
      setInquiry("myself");
      setWorkExp("");
    } catch (err) {
      alert("Error submitting application: " + err.message);
    }
  };

  return (
    <div className="homepage-container">
      {/* SIDE NAV */}
      <aside className="side-nav">
        <nav className="side-nav-menu">
          <Link to="/" className="side-nav-item">
            🏠 Home
          </Link>
          <Link to="/about" className="side-nav-item">
            👥 About
          </Link>
          <Link to="/lessons" className="side-nav-item">
            📚 Lessons
          </Link>
          <Link to="/quiz-categories" className="side-nav-item">
            ❓ Quiz
          </Link>
          <Link to="/contact" className="side-nav-item">
            📞 Contact Us
          </Link>
          <Link to="/register" className="side-nav-item">
            📝 Register
          </Link>
          <Link to="/login" className="side-nav-item">
            🔑 Login
          </Link>
        </nav>
      </aside>

      {/* MAIN CONTENT */}
      <main className="main-content">
        {/* HERO SECTION */}
        <section className="hero-section">
          <div className="hero-content">
            <h1>
              Courses YOU Need, Taught by the Best Instructors in the World.
            </h1>
            <p>
              Improve your sign language skills with interactive courses, taught
              by leading experts in the field. Start your journey today!
            </p>
            <div className="hero-buttons">
              <button className="browse-btn">Browse Upcoming Courses</button>
              <button className="highlight-btn">
                Dry Needling in Bellingham, WA!
              </button>
            </div>
          </div>
        </section>

        {/* Other sections remain unchanged */}
      </main>
    </div>
  );
};

export default HomePage;
